ch starts or ends at a particular time - because your visitors may be in a different time zone)&lt;/FONT&gt;&lt;/TD&gt;<br>		&lt;/TR&gt;<br>	&lt;/TBODY&gt;<br>&lt;/TABLE&gt;<br>&lt;/BODY&gt;<br><br>&lt;/HTML&gt;<br><br>',
